import React, { Component } from 'react';
import ResultsAPI from "../../API/ResultsAPI";
import Loader from "../loader/Loader";
interface YearRoundResultsInterface {
    info: any[],
    ready: any,

    year: string,
    round: number
}

type YearRoundResultsProps = {
    year: string,
    round: string,
};

class YearRoundResults extends Component<YearRoundResultsProps,  YearRoundResultsInterface> {
    constructor(props: any) {
        super(props);
        this.state = {
            info: [],
            ready: false,

            year: "",
            round: 0
        };
    }

    async componentDidMount() {
        const resultApi: ResultsAPI = new ResultsAPI()
        const info: any[] = await resultApi.ResultsByYearAndRound(parseInt(this.props.year), parseInt(this.props.round))
        this.setState({ info });
        this.setState({ready: true})

    }

    render() {
        console.log(this.state.info)
        return this.state.ready ? (
            <div className={"w-full h-full flex flex-col items-center p-10"}>
                YEES
            </div>
        ): <Loader/>
    }
}

export default YearRoundResults;
